// settings = {}

const initialState = {
		is_absences_layer: false,
		is_time_layer: false,
}

const settingsReducer = ( state, action ) => {
	switch ( action.type ) {
		case 'START': {
			return { ...state }
		}
		default:
			return state
	}
}

export default settingsReducer;
